import { Route,Routes, Redirect } from 'react-router-dom';
import { privateRoutes } from './component/routes';
import Login from "./pages/Login";

const AppRouter = () => {
    const user = false;
    return user ?
    (
        <Routes>
            {privateRoutes}
        </Routes>
    )
    :
    (
        <Routes>
        </Routes>
    )
};

export default AppRouter;
